/* eslint-disable no-nested-ternary */
import React, { forwardRef, useEffect, useState } from 'react';
import { Card, Button, Radio, Input, Checkbox, Row, Col, Tag } from 'antd';
import {
  CheckCircleOutlined,
  CloseCircleOutlined,
  ClockCircleOutlined,
} from '@ant-design/icons';
import classnames from 'classnames';
import localMessage from '../../locale';
import { isQA, isReviewEditable } from '../../../../utils/tool-mode';
import { isQATool } from '../../data/tag_mode';

const ReviewForm = forwardRef((props, ref) => {
  const {
    toolMode,
    tagReviewInfo,
    issueTypes,
    tagOpenReview,
    setFormVisible,
    onConfirm,
  } = props;

  const [comment, setCommit] = useState('');
  const [type, setType] = useState([]);
  const [result, setResult] = useState('reject');

  useEffect(() => {
    setResult(tagReviewInfo?.result || '');
    setType(tagReviewInfo?.type || '');
    setCommit(tagReviewInfo?.comment || '');
  }, [tagOpenReview, tagReviewInfo]);

  function confirm() {
    if (!isQATool(tagOpenReview?.id)) {
      if (result === 'pass') {
        onConfirm({
          result,
        });
      } else {
        onConfirm({
          result,
          type,
          comment,
        });
      }
    } else {
      onConfirm({
        result: 'missing',
        comment,
      });
    }
    setFormVisible(false);
  }

  function cancel() {
    if (isQATool(tagOpenReview?.id) && !tagReviewInfo) { // create an empty comment review as a placeholder
      onConfirm({
        result: 'missing',
        comment: '',
      });
    }
    setFormVisible(false);
  }

  return (
    <div className={classnames('review-wrapper', {
      'review-wrapper-display': tagOpenReview != null,
    })}
    >
      <Card
        className="review-form"
      >
        <h2>{tagOpenReview?.value}</h2>
        {
          !isQATool(tagOpenReview?.id)
            ? (
              <>
                {
              isReviewEditable(toolMode)
                ? (
                  <Radio.Group onChange={(e) => setResult(e.target.value)} value={result}>
                    <Radio.Button value="pass">{localMessage('pass')}</Radio.Button>
                    <Radio.Button value="reject">{localMessage('reject')}</Radio.Button>
                  </Radio.Group>
                )
                : (
                  <Tag
                    icon={result === '' ? <ClockCircleOutlined /> : result === 'reject' ? <CloseCircleOutlined /> : <CheckCircleOutlined />}
                    color={result === '' ? 'default' : result === 'reject' ? 'error' : 'success'}
                  >
                    {
                  result === '' ? localMessage('not-reviewed') : result === 'reject' ? localMessage('reject') : localMessage('pass')
                }
                  </Tag>
                )
            }
                {
              result === 'reject'
                ? (
                  <>
                    <h3 style={{ margin: 0 }}>{localMessage('type')}</h3>
                    <Checkbox.Group
                      value={type}
                      onChange={(v) => setType(v)}
                      className="review-checkbox"
                      disabled={!isReviewEditable(toolMode)}
                    >
                      <Row>
                        {
                        issueTypes?.split(',').map((val) => (
                          <Col span={8} key={val}>
                            <Checkbox value={val}>{val}</Checkbox>
                          </Col>
                        ))
                      }
                      </Row>
                    </Checkbox.Group>
                    <h3 style={{ margin: 0 }}>{localMessage('comment')}</h3>
                    <Input.TextArea
                      value={comment}
                      onChange={(e) => setCommit(e.target.value)}
                      disabled={!isReviewEditable(toolMode)}
                      onFocus={() => { window.disableTextHotKeys = true;}}
                      onBlur={() => { window.disableTextHotKeys = false;}}
                    />
                  </>
                )
                : null
            }
              </>
            )
            : (
              <Input.TextArea
                value={comment}
                onChange={(e) => setCommit(e.target.value)}
                disabled={!isReviewEditable(toolMode)}
              />
            )
        }
        <div>
          <Button className="review-form-btn" onClick={(e) => cancel()}>{localMessage('cancel')}</Button>
          <Button className="review-form-btn" onClick={(e) => confirm()} disabled={!isReviewEditable(toolMode)} type="primary">{localMessage('confirm')}</Button>
        </div>
      </Card>
    </div>
  );
});

export default ReviewForm;
